import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home/Home';  // Zorg ervoor dat je deze pagina hebt
import Login from './pages/Login/login';  // Zorg ervoor dat je deze pagina hebt

import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Welkom bij mijn React App</h1>
        </header>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />;
        </Routes>
      </div>
    </Router>
  );
}

export default App;
